#keyvisual-1  {
    padding:0!important;
}

.keyvisual {
  .card {
    background: transparent;
    border-radius: 0;
    border: none;

    .image-wrap {
      width: 100%;
      margin: 0 auto;
      overflow: hidden;
      position: relative;
    }

    .image-wrap img {
      width: 100%;
      animation: kenburns 8s ease;
      position: absolute;
    }

     .indent-me {
       text-align: center;

       .title-wrap {

       p {
         margin: 0;
         padding: 0;

         #firstpart {
           color: var(--white100);
           display:inline-block;
           animation: movefirst 5s ease 1s;
           text-shadow: 1px 1px 20px var(--black70)!important;
         }

         #secondpart {
           color: #fff; //var(--yellow);
           display:inline-block;
           animation: movesecond 5s ease;
           text-shadow: 1px 1px 20px var(--black70)!important;
         }
       }
     }
   }

/* Animation Keyframes */

  @-webkit-keyframes kenburns {
    0% {
      //transform-origin: center; Lighthosue doesnt love me ;(
      transform: scale(1.2);
    }
    50% {
      transform: scale(1.1);
    }

    100% {
      transform: scale(1.0);
    }
  }

  @-webkit-keyframes movefirst {
    0% {
      opacity: 0;
    }

    100% {
      opacity: 1;
    }
  }

  @-webkit-keyframes movesecond {
    0% {
      transform: translateX(-400%);
    }

    100% {
      transform: translateX(0%);
    }
  }
 }


/* media queries */

  @media only screen and (min-width: 20px) and (max-width: 280px) {
    .image-wrap {height: 57vw;}
    .image-wrap img {height: 57vw;}
    .title-wrap {font-size: 9vw;transform: translateY(2vw)!important;}
  }

  @media screen and (min-width: 281px) and (max-width: 320px) {
    .image-wrap {height: 57vw;}
    .image-wrap img {height: 57vw;}
    .title-wrap {font-size: 9vw;transform: translateY(2vw)!important;}
  }

  @media screen and (min-width: 321px) and (max-width: 360px) {
    .image-wrap {height: 53vw;}
    .image-wrap img {height: 53vw;}
    .title-wrap {font-size: 9vw;transform: translateY(2vw)!important;}
  }

  @media screen and (min-width: 361px) and (max-width: 567px) {
    .image-wrap {height: 50vw;}
    .image-wrap img {height: 50vw;}
    .title-wrap {font-size: 8vw;transform: translateY(8vw)!important;}
  }

  @media screen and (min-width: 568px) and (max-width: 768px) {
    .image-wrap {height: 40vw;}
    .image-wrap img {height: 40vw;}
    .title-wrap {font-size: 7vw;transform: translateY(6vw)!important;}
  }

  @media screen and (min-width: 769px) and (max-width: 1024px) {
    .image-wrap {height: 39vw;}
    .image-wrap img {height: 39vw;}
    .title-wrap {font-size: 6vw;transform: translateY(6vw)!important;}
  }

  @media screen and (min-width: 1025px) and (max-width: 1399px) {
    .image-wrap {height: 41vw;}
    .image-wrap img {height: 41vw;}
    .title-wrap {font-size: 7vw;transform: translateY(5vw)!important;}
  }

  @media screen and (min-width: 1400px) {
    .image-wrap {height: 40vw;}
    .image-wrap img {height: 40vw;}
    .title-wrap {font-size: 6vw;transform: translateY(8vw)!important;}
  }

}

sources.partials/elements-listblocks.scss:
.listblocks {
    padding-top: 2vw !important;

    .card {
        background: var(--babyblueshaded-3);
    }
    .card:nth-child(2) {
        background: var(--babyblue);
    }
    .card:nth-child(3) {
        background: var(--babyblueshaded-1);
    }
    .card:nth-child(4) {
        background: var(--babyblueshaded-2);
    }
    .card:nth-child(5) {
        background: var(--babyblueshaded-3);
    }

    .youarehere {
        color: #000 !important;
        opacity: 0.4 !important;
    }

    .listblock {
        height: 75px;
        border: none;

        a {
            color: #000; //var(--black80);
            text-decoration: none;
        }

        .icon .svg-inline--fa {
            color: var(--black80);
            width: 2rem;
            height: 2rem;
        }

        .card:nth-child(5) .icon .svg-inline--fa {
            transform: translateY(8px);
        }

        .first-layer {
            animation: blend-in 4s;
        }

        .second-layer {
            //position: relative; top: -80px;
            transform: translateY(-4.3rem);
            opacity: 0;

            .card-body {
                line-height: 1.2rem !important;
            }
        }
    }

    .listblock:hover {
        background: #85c6f8;

        .svg-inline--fa {
            color: var(--black70) !important;
            transform: translateY(6px);
        }

        .first-layer {
            opacity: 0;
            animation: blend-out 0.3s;
        }

        .second-layer {
            animation: blend-in 0.75s;
            opacity: 1;
        }
    }

    @keyframes blend-in {
        0% {
            opacity: 0;
        }
        50% {
            opacity: 0.8;
        }
        100% {
            opacity: 1;
        }
    }

    @keyframes blend-out {
        0% {
            opacity: 1;
        }
        50% {
            opacity: 0.25;
        }
        100% {
            opacity: 0;
        }
    }
}

